import React from "react";
import searchButton from "../../images/find.svg";
import magnifierIcon from "../../images/magnifier.svg";
import "../SearchForm/SearchForm.css";
import FilterCheckbox from "../FilterCheckbox/FilterCheckbox";

function SearchForm() {
  return (
    <div className="search-form">
      <div className="search-form__field">
        <FilterCheckbox />
        <div className="search-form__input-container">
          <input 
            placeholder="Фильм" 
            type="text" 
            className="search-form__input"
          />
          <button className="search-form__icon-container">
            <img
              src={searchButton}
              className="search-form__icon"
              alt="Search Icon"
            />
          </button>
        </div>
        <div className="search-form__icon-container">
          <img
            src={magnifierIcon}
            className="search-form__icon-magnifier"
            alt="Magnifier Icon"
          />
        </div>
      </div>
      <div className="search-form__line"></div>
    </div>
  );
}

export default SearchForm;
